<?php

namespace App\Http\Controllers;

use Illuminate\Http\Request;
use Illuminate\Support\Facades\Redis;

ini_set("max_execution_time", 0);   // no time-outs!
ini_set("request_terminate_timeout", 2000);   // no time-outs!
ini_set('memory_limit', -1);
ini_set('display_errors', 1);

ignore_user_abort(true);            // Continue downloading even after user closes the browser.
error_reporting(E_ALL);

class FocoController extends Controller
{
    public function index(){
        $images = Redis::keys('foco:img:*');
        foreach($images as $key_img){
            echo "\n".Redis::get($key_img);

            $template_id = str_replace('foco:img:',null,$key_img);
            $img_url = Redis::get($key_img);
            $local_img_path = public_path('/foco/public/design/template/'.$template_id.'/assets/');
            
            self::downloadImage( $img_url, $local_img_path, $template_id );

            // echo $template_id;
        }
        exit;
        exit;
