        //     // print_r($path_info);
        //     Redis::set('foco:img:'.$path_info['filename'], $url);
        // }
        
        // self::requestImage();
    }

    function downloadImage( $img_url, $local_img_path, $template_id ){
        $url_info = pathinfo($img_url);
        $full_local_img_path = $local_img_path.$url_info['basename'];
        // echo "\n<br>".$full_local_img_path;
        // exit;
       
        $path_info = pathinfo($full_local_img_path);
        $path = $path_info['dirname'];
        $file_name = $path_info['basename'];

        if (file_exists($full_local_img_path) == false) {
            
            
            @mkdir($path, 0777, true);
        
            set_time_limit(0);
        
            //This is the file where we save the    information
            $fp = fopen ($path . '/'.$file_name, 'w+');
            //Here is the file we are downloading, replace spaces with %20
            $ch = curl_init(str_replace(" ","%20",$img_url));
            curl_setopt($ch, CURLOPT_TIMEOUT, 50);
            // write curl response to file
            curl_setopt($ch, CURLOPT_FILE, $fp); 
            curl_setopt($ch, CURLOPT_FOLLOWLOCATION, true);
            // get curl response
            curl_exec($ch); 
            curl_close($ch);
            fclose($fp);
        }

        return $file_name;
    }
    
    function requestImage(){
        
        $curl = curl_init();
        
        curl_setopt_array($curl, array(
          CURLOPT_URL => "https://st-gdx.dancf.com/gaodingx/0/uxms/design/20200602-114609-b831.png?x-oss-process=image/resize,m_mfit,h_371,w_371/format,webp",
          CURLOPT_RETURNTRANSFER => true,
          CURLOPT_ENCODING => "",
          CURLOPT_MAXREDIRS => 10,
          CURLOPT_TIMEOUT => 0,
          CURLOPT_FOLLOWLOCATION => true,
          CURLOPT_HTTP_VERSION => CURL_HTTP_VERSION_1_1,
          CURLOPT_CUSTOMREQUEST => "GET",
          CURLOPT_HTTPHEADER => array(
            "Host: st-gdx.dancf.com",
            "user-agent: FocoDesign/1.1.4 (iPhone; iOS 14.3; Scale/2.00)",
            "accept: image/*,*/*;q=0.8",
            "accept-language: en-us"
          ),
        ));
        
        $response = curl_exec($curl);
        
        curl_close($curl);
        echo $response;

    }

    

